import styles from "./CardsDisplay.module.css";

const CardsDisplay = ({ characters }) => {
  return (
    <div className={styles.cardSection}>
      {characters.map((character) => (
        <Card style={{ width: "320px" }} className="m-3">
          <Card.Img variant="top" src={character.img} height={400} />
        </Card>
      ))}
    </div>
  );
};

export default CardsDisplay;
